import React from "react";

export const Card = (props) => {
  const { supply, title, desc, num_last_week, num_last_month } = props;
  return (
    <div className="">
      <div className="mt-2 box">
        <div className="p-3 rounded-top box1 d-flex justify-content-between">
          <div>
            <div>{supply}</div>
            <div>{title}</div>
            <div>{desc}</div>
          </div>
          <div className="icon text-center bg-danger ">
            <i class="fa-solid fa-cart-shopping"></i>
          </div>
        </div>

        <div className="p-3 mt-2 rounded-bottom box1 box2">
          <div>{num_last_week}</div>
          <div>{num_last_month}</div>
        </div>
      </div>
    </div>
  );
};
